import React from 'react';
import portada from '../img/portadabanco.jpg';
import Carousel from './Carousel';
import Header from './Header';
import Footer from './Footer';
import '../estilos/estilos_inicio.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

const Main = () => {
  return (
    <div>
      <Header />

      <main>
        <section className="container encabezado_main">
          <div className="encabezado_textos">
            <h1 className="title">
              Tu dinero disponible{' '}
              <span className="title--active">en cualquier momento y lugar</span>
            </h1>
            <p className="copy">
              El mejor refugio para tus ahorros
              <span className="copy_active">, aquí, en nuestro banco.</span>
            </p>
            <a href="#info" className="cta">
              Conoce más ▼
            </a>
          </div>
          <img src={portada} className="portada" alt="Portada Banco" />
        </section>

        <section id="info" className="info">
          <div className="container">
            <h2 className="subtitle">Servicios Online</h2>
            <p className="copy_section">
              Encuentra todo lo que necesitas sin moverte de tu hogar.
            </p>

            <Carousel />
          </div>
        </section>
      </main>

      <Footer />
    </div>
  );
};

export default Main;
